import React from 'react';
import './ReportsLayout.css';

const ReportsLayout = () => {
  return (
    <div className="reports-layout">
      <h2>Your Reports</h2>
      <p>Here will be your reports.</p>
    </div>
  );
};

export default ReportsLayout;
